import React from "react";
import logo from "./logo192.png";

import { ProjectPageStyle } from "../../styles/ProjectPage.style.ts";

function image() {
  return <img src={logo} alt="Logo" />;
}

function ProjectPage() {
  return (
    <ProjectPageStyle>
      <p>Hello</p>
      <image />
    </ProjectPageStyle>
  );
}

export default ProjectPage;
